import { useState } from "react";


let time = new Date();
time = time.toLocaleDateString();
console.log(time)

const App2 = () => {

  const [count,setcount] = useState(0);
  

  const Incr = () => {
         setcount(count+1);
  }

  return (
    <>
      <h1>{count}</h1>
      <button onClick={Incr}>Click me</button>
    </>
  )
}

export default App2;
